import React from "react";
import {
  interaction,
  layer,
  custom,
  control, //name spaces
  Interactions,
  Overlays,
  Controls, //group
  Map,
  Layers,
  Overlay,
  Util, //objects
} from "react-openlayers";
import ol from 'openlayers';


export const MapPage = () => {
  return (
    <Map >
      <Layers>
        <layer.Tile />
      </Layers>
      <Controls attribution={false} zoom={true}></Controls>
    </Map>
  );
};
